export default class GoodList extends Component {
  state = {
    goods: _goods
  }
  cPage = 1
  isLoading = false
  componentDidShow () {
    console.log('onShow')
  }
  onReachBottom () {
    
    if(this.isLoading || this.cPage > 10) return
    this.cPage ++
    // this.getData()
  }
  getData () {
    this.isLoading = true
    Taro.request({
      url: '',
      data: {
        _format_: 'json',
        page: this.cPage,
        haspin: 0
      },
      header: {
        'content-type': 'application/json'
      }
    })
    .then(res => {
      const goods = JSON.parse(res.data.recommend).wareInfoList
      this.isLoading = false
      this.setState({
        goods: this.state.goods.concat(goods)
      })

    })
  }
  componentWillMount () {
    // this.getData()
  }
  render () {
    return (<View className='msite-rec__goods'>
      <View style='overflow: hidden;'>
      {this.state.goods.map((item, idx) => <GoodItem good={item} key={item.wareId} />)}
      </View>
      <View style='display: block;text-align: center;line-height:30px;'>Loading...</View>
      </View>)
  }
}